import { useEffect } from "react";
import { useParams } from "react-router";
import { getmoviedetails } from "../component/services/Movies";
const Moviedetails = () => {
    let {location}=useParams()
    let{id}=useParams()
    const [movies,setmovies]=useState<Imovies>([])
  useEffect (
   
    ()=>{
      const helper = async ()=>{
      const movies= await getmoviedetails(location,id);
      setmovies(movies);
      }
      helper()
    }

  ,[]);
    return ( 
        <div>Movie Details</div>
     );
}
 
export default Moviedetails;
